commits.sourceNew:
private Line2D(Line line) {
  this.minY = line.minLat;
  this.maxY = line.maxLat;
  this.minX = line.minLon;
  this.maxX = line.maxLon;
  this.tree = EdgeTree.createTree(line.getLons(), line.getLats());
}

